INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "春咲 ひより", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 0, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", "草野 優衣", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "キミに必要な集中力と感性が", "フェンシングを始めてみては？", 0, 1003, "少しは磨かれると思いますよ。", "士条 怜", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 0, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", "穂高 みそぎ", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "ねぇ…", "風宮あかりです", 0, 1006, "私といっしょに…\nいかない？", "風宮 あかり", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "プリンたべたいのー", "出雲宮子なのー", 0, 1007, "食べ物の恨みは怖いのー", "出雲 宮子", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 0, 1008, "いいよ。\n見られることは運命さ…", "虹村 雪", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 0, 1009, "人呼んで「疾風の冥姫」!!", "柊杏奈", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1010, "ほんまおおきにやわ～♪", "姫宮 真歩", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 0, 1011, "ここで会ったが\n100年目～！", "衣之咲 璃乃", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1012, "…って、お願い！\n誰にも言わないでおいて～！", "柏崎 初音", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 0, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "美波 鈴奈", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 0, 1017, "でも、沖縄もとってもいいとこさー", "喜屋武 香織", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 0, 1018, "イオちゃんって呼んでね。", "支倉 伊緒", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1020, "ミミをおいてかないでぇ～", "茜 ミミ", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1021, "ふぇぇぇぇぇん……", "栗林 くるみ", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 0, 1022, "なんてありがとうございます！", "風宮 より", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1023, "私こっち行きたいー\nね、早く早くー", "北条 綾音", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 0, 1025, "これて何か違う…\nあああすみません！", "天野 すずめ", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 0, 1027, "離しませんわ………\n絶対に…!!", "倉石 恵理子", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1028, "…そうでしょ？？", "佐々木 咲恋", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 0, 1029, "あはは、\n私もまだまだだなぁ～", "桜井 望", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 0, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", "ニノン・ジュベール", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 0, 1031, "おかしいですね……", "上喜 しのぶ", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1033, "そう、\nオラのボケに突っ込める相方が…！", "野戸まひる", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1034, "ちょ\nちょっと一杯飲んできます…！", "綾瀬 ゆかり", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "知らない人とは話しちゃいけないので", "氷川鏡華…です", 0, 1036, "これ以上お話しすることは…\nないです！", "氷川 鏡華", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "……あ、アラーム。", "柏崎…栞です。", 0, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎 栞", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "私、一人も友達がいなくて……", "ふ、双葉碧です。", 0, 1040, "野に咲く花が、\n唯一の話相手です。", "双葉 碧", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 0, 1042, "そう思っています。", "三角 千歌", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 0, 1043, "う、疑ってすまなかったな…", "安芸 真琴", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 0, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "イリヤ・オーンスタイン", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 0, 1045, "ｌク、クウカに何かご用ですか!?", "遠見 空花", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまき", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "それでは早速クエストに…", "大神美冬よ！", 0, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神 美冬", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 0, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 0, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "玉泉美咲", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "？？？？", "？？？", 0, 1052, "？？？？", "リマ", 1.4, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1053, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィント", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1058, "そ、そこまでいうなら\nもらってやる", "ペコリーヌ", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1059, "そ、そこまでいうなら\nもらってやる", "コッコロ", 1.5, 0, 0, 1);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 1, 2, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1060, "そ、そこまでいうなら\nもらってやる", "キャル", 1.5, 0, 0, 1);
